import React, {useState, useEffect} from "react";

function Welcome() {
    return (
        <div className="welcome-container">
            <h1>Welcome!</h1>
            <h3>Would You Like to Sign Up or Sign In?</h3>
            <button>Sign Up</button>
            <button>Sign In</button>
        </div>
    );
}

export default Welcome;
